import React, { useState } from 'react';

interface RatingProps {
    userName: string;
    Group: string;
    Rate: string;
    Nac: string;
  }

const RatingMember: React.FC<RatingProps> = (props) => {
  return (
    <div>
        <div className='RatingMember'>
            <div>{props.userName}</div>
            <div>{props.Group}</div>
            <div>{props.Rate}</div>
            <div>{props.Nac}</div>
        </div>
      </div>
  );
};

export default RatingMember;
